import style from "./review.module.css";

const Review = ({jobDescription, company, reviewBody, country}) => { 

    // const countryPath = '../../flags/' + country + '.png';
    return (
        <div className={style.review}>
            <div className={style.reviewHeader}>
            <h1 className={style.jobDescription}> { jobDescription } </h1>
            <p> {company} </p>
           <img className={style.image} 
            src="https://flagcdn.com/w20/se.png"
            srcset="https://flagcdn.com/w40/se.png 2x" 
            alt="Sweden" />
            </div>
            <p> {reviewBody} </p>
            <p className={style.readMore}>Read More</p>
            <i></i>
            <img src="" alt="" />
            <img src="" alt="" />
            <img src="" alt="" />
            <img src="" alt="" />

        </div>
    );
};

export default Review;

